// src/pages/Dashboard.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Dashboard.css';

const Dashboard = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  const features = [
    { label: 'Payments', path: '/payments' },
    { label: 'Complaints', path: '/complaints' },
    { label: 'Emergency Alerts', path: '/emergency' },
    { label: 'Visitor Tracking', path: '/visitors' },
    { label: 'Polling/Voting', path: '/polling' },
    { label: 'Parking Management', path: '/parking' },
    { label: 'Courier Alerts', path: '/couriers' },
    { label: 'Multi-language Support', path: '/languages' },
  ];

  return (
    <div className="dashboard">
      <header className="dashboard-header">
        <h1>üè° Welcome to Your Community Dashboard</h1>
        <button onClick={handleLogout} className="logout-button">Logout</button>
      </header>

      <div className="dashboard-grid">
        {features.map((feature, index) => (
          <button
            key={index}
            className="dashboard-button"
            onClick={() => navigate(feature.path)}
          >
            {feature.label}
          </button>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
